import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header'; // Assuming Header is in components folder
import Home from './pages/Home';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import MovieWishlist from './pages/MovieWishlist';
import SignUp from './pages/SignUp';
import AddMovie from './pages/AddMovie';
import EditMovie from './pages/EditMovie';
import MovieDetails from './pages/MovieDetails';
import UserProfile from './pages/UserProfile';
import AdminDashboard from './pages/AdminDashboard';
import Search from './pages/Search';
import LogoutConfirmation from './pages/LogoutConfirmation';
import NotFound from './pages/NotFound';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Add the Header component so it's visible on every page */}
        <Header />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/wishlist" element={<MovieWishlist />} /> {/* Fixed the path for wishlist */}
          <Route path="/signup" element={<SignUp />} />
          <Route path="/add-movie" element={<AddMovie />} />
          <Route path="/edit-movie/:id" element={<EditMovie />} />
          <Route path="/movie-details/:id" element={<MovieDetails />} />
          <Route path="/profile" element={<UserProfile />} />
          <Route path="/admin" element={<AdminDashboard />} />
          <Route path="/search" element={<Search />} />
          <Route path="/logout" element={<LogoutConfirmation />} />
          <Route path="*" element={<NotFound />} /> {/* Catch-all for undefined routes */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
